        public static int LengthOfLongestSubstring(string text)
        {
            if (text == "") return 0;
            int length = 0;
            int leftWindowBorder = 0;
            int min = text[0];
            int max = text[0];
            for (int i = 1; i < text.Length; i++)
            {
                int c = text[i];
                min = min < c ? min : c;
                max = max > c ? max : c;
            }

            var mp = new int[max - min + 1];
            for(int rightWindowBorder = 0; rightWindowBorder < text.Length; rightWindowBorder++)
            {
                int coord = text[rightWindowBorder] - min;
                int nextPos = mp[coord];
                if (nextPos > 0 && nextPos > leftWindowBorder) leftWindowBorder = nextPos;
                int currentWindowSize = rightWindowBorder - leftWindowBorder + 1;
                if (currentWindowSize > length) length = currentWindowSize;
                mp[coord] = rightWindowBorder + 1;
            }

            return length;
        }
    }
